const Header = ({ title }) => {
  return (
    <header>
      <h1>Toggy Smith</h1>
      <ul>
        <li className="button">
          <a href="#">Home</a>
        </li>
        <li className="button">
          <a href="#">About</a>
        </li>
        <li className="button">
          <a href="#">Contact</a>
        </li>
      </ul>
    </header>
  );
};

Header.defaultProps = {
  title: "Bob Tucker",
};

export default Header;
